import React from 'react';

const User = ({ id, name, username, email }) => {
    return(
        <div className='userContainers' id={id}>
            <h1>Name: {name}</h1>
            <h2>Username: {username}</h2>
            <p>Email: {email}</p>

        </div>
    );
}

export default User;
